(9827, 8320, 0, 7, 'Do You Wanna (feat. LBC,PG)', '', '0000-00-00 00:00:00', 0000, 15, 0, 2, '<Sarah S & Lil Yudy>\r\n芭呀芭呀.............\r\n(這首不錯 那首也很對味)\r\n芭芭芭芭.....................\r\n(聽著哼著 every night & day)\r\n\r\nDo u wanna (what~) Do u wanna (what!)\r\nDo u wanna (tell me I''m gettin reday)\r\n\r\nDo u wanna get down\r\nWit Formosa G-Funk\r\nHood ridin till the dawn (on and on~and on~and on~)\r\n\r\nDo u wanna get down\r\nWit Formosa G-Funk\r\nHood ridin till the dawn (聽著哼著 every night & day)\r\n\r\n\r\n<巧克力>\r\nMonday 2 Friday我聽著 Every Holiday We Make\r\n從之前到現在 堅持這種風格\r\n他佔據了我生活大半時間 我電腦硬碟空間\r\nOnly WestCoast Shit 怎麼能不說他是我的一切\r\n我的一切 It Ain''t No Change\r\n就像每天主食不會少了 飯跟麵\r\n你爸媽討厭你 說你不爭氣 你總是曠課 無故缺席\r\n我準時上課 G放課 放課後補習 I''ma G LUV\r\nLBC LiL Yudy P.G~ We Do You Hear G-Funk Your Luv\r\n我們西岸中毒太深了 一點也不潮流 But You Can''t Fade Us\r\n\r\n\r\n<PG>\r\n有種放克 we called dat G\r\n音樂放著 輕易let us chill\r\n舒服的旋律 它的旋律 像冬天的熱茶 夏天的冰\r\n我愛的 是它獨特的風格\r\n享受的 是它能解我的渴 share我的餓\r\n我們沿著 線索 像學者尋它的根\r\n不論走過的路 種過的樹\r\n或它跳過的音符 住過的屋\r\n我們收藏 所有它的過去\r\n而且嚮往 它所有的動向\r\n像是中毒 卻又不願去戒除\r\n對它的崇拜 對它的愛\r\n我們是受洗後虔誠的信徒\r\n用點頭來 歌誦對它的依賴\r\n\r\n\r\n<Lil Yudy>\r\n對 就是這個味 讓我們每天靈魂天上飛\r\n飛 飛進白雲堆 空氣裡好像有酒精 呼吸也會醉\r\n你不曠課 我就準時放課 我開的課 你們搶著選課\r\n沒有大道理 隨意擺動身體 繼續 let me hear u say yeah\r\n\r\n\r\nVocal by:Sarah s, Lil Yudy\r\nProduced by:Lil Yudy', '', 251, '', 'Lil Yudy', 'Lil Yudy,LBC,PG', 'Lil Yudy', 'FTC(Formosa Thang Crew)', '', 1, 1, 0, '2008-12-12 03:43:23', '2015-03-12 13:35:20', '0000-00-00 00:00:00'),
