(10022, 8469, 1159, 1, 'Building A Mystery', '', '1997-07-15 00:00:00', 0000, 20, 0, 4, '', 'You come out at night\nThat''s when the energy comes\nAnd the dark side''s light\nAnd the vampires roam\nYou strut your rasta wear\nAnd your suicide poem\nAnd a cross from a faith that died\nBefore Jesus came\nYou''re building a mystery\n\nYou live in a church\nWhere you sleep with voodoo dolls\nAnd you won''t give up the search\nAnd you won''t give up the search\nFor the ghosts in the halls\nYou wear sandals in the snow\nAnd a smile that won''t wash away\nCan you look out the window\nWithout your shadow getting in the way?\n\nYou''re so beautiful\nWith an edge and charm\nBut so careful\nWhen I''m in your arms\n\n[Chorus]\n''Cause you''re working\nBuilding a mystery\nHolding on and holding it in\nYeah you''re working\nBuilding a mystery\nAnd choosing so carefully\n\nYou woke up screaming aloud\nA prayer from your secret god\nYou feed off our fears\nAnd hold back your tears, oh\nGive us a tantrum\nAnd a know it all grin\nJust when we need one\nWhen the evening''s thin\n\nYou''re a beautiful\nA beautiful ****ed up man\nYou''re setting up your\nRazor wire shrine\n\n''Cause you''re working\nBuilding a mystery\nHolding on and holding it in\nYeah you''re working\nBuilding a mystery\nAnd choosing so carefully\n\nOh, you''re working, \nBuilding a mystery\nHolding on and holding it in\nYeah you''re working\nBuilding a mystery\nAnd choosing so carefully\nYeah, you''re working,\nBuilding a mystery,\nHolding on and holding it in,\nOh yeah you''re working,\nBuilding a mystery\nAnd choosing so carefully\n', 247, '', '', '', '', '', '', 0, 1, 0, '2008-12-16 17:44:59', '2015-03-12 13:35:26', '0000-00-00 00:00:00');
